      {value}
    </button>
  );
}
//usestate is used to remmebr things....
export default function Board() {
  return (
    <>
      <div className="board-row">
        <Square value="1" />
        <Square value="2" />
        <Square value="3" />
      </div>
      <div className="board-row">
        <Square value="4" />
        <Square value="5" />
        <Square value="6" />
      </div>
      <Square value="7" />
      <Square value="8" />
      <Square value="9" />
    </>
  );
}
